import React  from "react";
import{component} from 'react'
import PosteNote from "./PosteNote";

function PosteList({posts})  {
    return <>
        {posts.map((post) =>
            <PosteNote post={todo.id} ></PosteNote>
        )}
    </>
}

export default PosteList
